import React, { useState } from "react";
import Arrow_up from "../asset/arrow_up.png";
import Arrow_down from "../asset/arrow_down.png";
import Cat from "../asset/cat.png";
import clsx from "clsx";
import styles from "../app.module.css";


const NestedList3 = () => {
  const [div3, setDiv3] = useState(true);
  const arrow_up_function = () => {
    setDiv3(false);
  };
  const arrow_down_function = () => {
    setDiv3(true);
  };

  return (
    <div className="nestlist1 ">
      <div>
        <div>
          <p>Package</p>
          {div3 ? (
            <img
              onClick={() => {
                arrow_up_function();
              }}
              src={Arrow_up}
              alt="arrow_up"
            ></img>
          ) : (
            <img
              onClick={() => {
                arrow_down_function();
              }}
              src={Arrow_down}
              alt="arrow_up"
            ></img>
          )}
        </div>
        <div className={clsx(div3 && styles.disappear)}>
          <div>
            <img src={Cat} alt="cat"></img>
            <p>Eslint</p>
          </div>
          <div>
            <img src={Cat} alt="cat"></img>
            <p>SASS/SCSS</p>
          </div>
          <div>
            <img src={Cat} alt="cat"></img>
            <p>clsx</p>
          </div>
          <div>
            <img src={Cat} alt="cat"></img>
            <p>Material-UI</p>
          </div>
          <div>
            <img src={Cat} alt="cat"></img>
            <p>Mock.js</p>
          </div>
          <div>
            <img src={Cat} alt="cat"></img>
            <p>i18n</p>
          </div>
          <div>
            <img src={Cat} alt="cat"></img>
            <p>three.js</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default NestedList3;
